                $audioName = str_replace(' ', '-', $song->name).'.mp3';
                $audioFile = file_get_contents($song->audio);
                $this->fileService->uploadAudio($audioFile, $audioName);
                $song->update([
                    'audio' => $audioName,
                ]);
            }
            $song->singers()->attach($sIds);
            $song->genres()->attach($genres[$i - 1]);
            $i += 1;
        }        
    }
}
